import React from 'react';
import { Link } from 'react-router-dom';

const Header = () => {
    return (
        <header className='bg-white bottom '>
            <div className='flex item-center justify-between h-[60px]'>
                <Link to="/">
                    <div className='bg-logo-instagram h-[29px] bg-[0px_0px]  bg-[length:176px_181px] bg-no-repeat' />
                </Link>
            </div>
        </header>
    );
};

export default Header;
